    "2016-07-15T19:13:02.364748",nt"name": "quarterly-survey-of-plant-capacity-utilization",nt"isopen":
    true,nt"url": null,nt"notes": "Provides quarterly statistics on the rates
    of capacity utilization for the U.S. manufacturing and publishing sectors. The QPC
    survey collects statistics on establishment operational status, value of actual
    production, estimated production attainable at full and emergency conditions, and
    reasons for operating at less than full production capacity. The survey also collects
    data on work patterns by shift. These data include days per week in operation, plant
    hours per week in operation, and weeks in operation in the Quarter. The Federal
    Reserve Board benchmarks monthly estimates of capacity output and utilization. In
    addition, analyze the change in use of capital, capital stocks and inputs related
    to capacity growth. The Department of Defense uses the data to assess readiness
    to meet demand for goods under selected national emergency scenarios.",nt"license_title":
